import styled from "styled-components";
import "./App.css";
import {createBrowserRouter, ro} from "react-router-dom";
import { GlobalStyles } from "./styles/GlobalStyles.styles";
import { mixins } from "./styles/GlobalStyles.styles";
import ModalTest from "./components/Modaltest";
import Layout from "./components/layout/Layout";
import MainPage from "./pages/MainPage"; // 메인 페이지
import LoginPage from "./pages/LoginPage"; // 로그인 페이지
import DetailPage from "./pages/DetailPage"; // 상세 페이지

const Title = styled.h4`
  font-family: var(--pretendard);
  font-weight: normal;
  ${mixins.border({ color: "blue", width: 10 })};
`;

function App() {
  return (
    <>
      <GlobalStyles />
      <Router>
        <Routes>
          {/* 메인 페이지 */}
          <Route
            path="/"
            element={
              <Layout>
                <MainPage />
              </Layout>
            }
          />

          {/* 로그인 페이지 */}
          <Route
            path="/login"
            element={
              <Layout>
                <LoginPage />
              </Layout>
            }
          />

          {/* 상세 페이지 */}
          <Route
            path="/detail/:id"
            element={
              <Layout>
                <DetailPage />
              </Layout>
            }
          />
        </Routes>
      </Router>
    </>
  );
}

export default App;
